import React from 'react';
import Link from 'next/link';

import { Card, Button, Formik as FormikBentcare } from '@bentcare/core';
import { Formik, Form } from 'formik';

import { Container, Row } from './styles';

const { Select } = FormikBentcare;

const AppointmentForm: React.FC = () => {
  return (
    <Container>
      <Card size="small" fullWidth>
        <Formik initialValues={{}} onSubmit={() => {}}>
          <Form>
            <Select fullWidth label="Escolha sua região" name="regiao">
              <option>Franca</option>
              <option value="1">Option 01</option>
              <option value="2">Option 02</option>
            </Select>
            <Select
              fullWidth
              label="Escolha a especialidade"
              name="especialidade"
            >
              <option value="Cardiologia">Cardiologia</option>
              <option value="Geriatria">Geriatria</option>
              <option value="Ortopedia">Ortopedia</option>
            </Select>
            <Link href="consulta">
              <Button appearance="primary" fullWidth label="Agendar" />
            </Link>
            <Row>
              <Button appearance="secondary" fullWidth label="Como funciona" />
              <Button appearance="secondary" fullWidth label="Ver preço" />
            </Row>
          </Form>
        </Formik>
      </Card>
    </Container>
  );
};

export default AppointmentForm;
